import React from "react";
import './navbar.css';
import { Link } from "react-scroll";

const Navbar = () => {
return(
    <nav className="navbar">
        <img src="./LogoU.png" alt="logo" className="logo" /> {/* For logo  */}
        <div className="desktopmenu"> {/* For Navbar menus */}
        <Link activeClass="active" to="intro" spy={true} smooth={true} offset={-100} duration={500}
                     className="desktopmenulists">Home</Link>
        <Link activeClass="active" to="works" spy={true} smooth={true} offset={-100} duration={500}
                    className="desktopmenulists">Skills</Link>
        <Link activeClass="active" to="skills" spy={true} smooth={true} offset={-100} duration={500}
                    className="desktopmenulists">Portfolio</Link>
        <Link activeClass="active" to="" spy={true} smooth={true} offset={-100} duration={500}
                    className="desktopmenulists">Contact Me</Link>

        </div>
        <button className="desktopmenubtn">
           Contact Me</button>
    </nav>

)};

export default Navbar;
